import Navbar from './components/Navbar';
import Posts from './components/posts/Posts';
import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Container>
        <Posts />
      </Container>
    </div>
  );
}

export default App;
